const Digital = ()=>{
let time = new Date().toLocaleTimeString()
const [data,setData] = useState(time)

   const showWatch=()=>{
    time = new Date().toLocaleTimeString()
    setData(time)
    
   }
   setInterval(showWatch, 1000)
    return(
        <>
            <h1>{data}</h1>
        </>
    )
}
export default Digital;
